description.p:
One embodiment of this disclosure, hereinafter embodiment [IV], relates to a method to determine NCIDi, as fully described immediately below.
[IV]-1. A method to determine the Non-Comonomer Index Distribution, NCDIi, of an ethylene interpolymer product, comprising:
a) placing from about 150 to about 300 mg of said ethylene interpolymer product into a sample dissolution vessel of a Polymer Char Crystaf-TREF unit;
b) dissolving said ethylene interpolymer product by adding 35 mL of solvent to said dissolution vessel, heating said vessel to 140° C., then stirring for about 2 to about 3 hours to form a polymer solution; wherein said solvent is 1,2,4-trichlorobenzene containing 250 ppm of 2,6-di-tert-butyl-4-methylphenol;
c) transferring said polymer solution to a TREF column and equilibrating said TREF column at 110° C. for about 20 to about 45 minutes;
d) cooling said polymer solution by reducing the temperature of said TREF column to 30° C., employing a cooling rate of 0.2° C./minute, to form a crystallized ethylene interpolymer product and equilibrating said TREF column at 30° C. for 90 minutes;
e) heating said TREF column to a first dissolution temperature, employing a heating rate of 1.0° C./min, and maintaining said TREF column at said first dissolution temperature for at least 50 minutes;
f) eluting a first TREF fraction from said TREF column using said solvent flowing at 1 mL/minute;
g) transferring said first TREF fraction through a heated transfer line into a Size Exclusion Chromatography (SEC) unit operating at 140° C. to produce an SEC effluent; wherein said heated transfer line is maintained at 140° C.;
h) passing said SEC effluent through a SEC detection system; wherein said SEC detection system includes a differential refractive index detector (DRI) to determine a polymer concentration; a dual-angle (15° and 90°) light scattering detector to determine a viscosity average molecular weight, Mvf; and, a differential viscometer to determine an intrinsic viscosity, [η]f, of said first TREF fraction; wherein superscript f represents the fth TREF fraction, where f=1 for said first TREF fraction;
i) calculating a Non-Comonomer Index, NCIf, of said first TREF fraction according to Eq. (4);

An additional embodiment of this disclosure, hereinafter embodiment [V], relates to the manufacture an ethylene interpolymer product having intermediate branching, as fully described immediately below.
[V]-1. A continuous solution polymerization process wherein an ethylene interpolymer product is produced, wherein said ethylene interpolymer product is characterized as having an intermediate branching, wherein said intermediate branching is characterized by a Non-Comonomer Index Distribution, NCIDi, comprising:
a) injecting ethylene, a process solvent, a first catalyst formulation, one or more α-olefins and optionally hydrogen into a first reactor to produce a first exit stream containing a first ethylene interpolymer in said process solvent;
b) passing said first exit stream into a second reactor and injecting into said second reactor, ethylene, said process solvent, an intermediate branching catalyst formulation, one or more α-olefins and optionally hydrogen to produce a second exit stream containing a second ethylene interpolymer and said first ethylene interpolymer in said process solvent;
c) optionally adding a catalyst deactivator A to said second exit stream, downstream of said second reactor, forming a deactivated solution A;
d) passing said second exit stream, or optionally said deactivated solution A, into a third reactor and optionally injecting into said third reactor, ethylene, process solvent, one or more α-olefins, hydrogen and a third catalyst formulation to produce a third exit stream containing an optional third ethylene interpolymer, said second ethylene interpolymer and said first ethylene interpolymer in said process solvent;
e) adding a catalyst deactivator B to said third exit stream, downstream of said third reactor, forming a deactivated solution B; with the proviso that e) is skipped if said catalyst deactivator A was added in c);
optionally, b) through e) are skipped and replaced with f) through j), with the proviso that if b) through e) are not skipped, e) is followed by k);
f) injecting ethylene, said process solvent, an intermediate branching catalyst formulation, one or more α-olefins and optionally hydrogen into a second reactor to produce a second exit stream containing a second ethylene interpolymer in said process solvent;
g) combining said first and said second exit streams, downstream of said second reactor, to form a third exit stream;
h) optionally adding a catalyst deactivator A to said third exit stream forming a deactivated solution A;
i) passing said third exit stream into a third reactor and optionally injecting into said third reactor, ethylene, said process solvent, one or more α-olefins, hydrogen and a third catalyst formulation to produce a fourth exit stream containing an optional third ethylene interpolymer, said second ethylene interpolymer and said first ethylene interpolymer in said process solvent;
j) adding a catalyst deactivator B to said fourth exit stream, downstream of said third reactor, forming a deactivated solution B; with the proviso that j) is skipped if said catalyst deactivator A was added in h);
k) adding a passivator to said deactivated solution A or said deactivated solution B to form a passivated solution;
l) phase separating said passivated solution to recover said ethylene interpolymer product;
wherein said ethylene interpolymer product is characterized by said Non-Comonomer Index Distribution, NCIDi, having a value characterized by Eq. (1a) and Eq. (1b);
wherein, Mo is a peak molecular weight that characterizes a molecular weight distribution of said second ethylene interpolymer when fit to a log normal distribution;
wherein a first derivative of said NCIDi,

ul.li:
[V]-7. The process as described in [V]-1, wherein said intermediate branching catalyst formulation is an in-line intermediate branching catalyst formulation formed in an in-line process comprising:
a) forming a first product mixture in a first heterogeneous catalyst assembly by combining a stream S1 and a stream S2 and allowing said first product mixture to equilibrate for a HUT-1 seconds; wherein said stream S1 comprises a magnesium compound and an aluminum alkyl in said process solvent and said stream S2 comprises a chloride compound in said process solvent;
b) forming a second product mixture in said first heterogeneous catalyst assembly by combining said first product mixture with a stream S3 and allowing said second product mixture to equilibrate for a HUT-2 seconds; wherein said stream S3 comprises a metal compound in said process solvent;
c) forming said in-line intermediate branching catalyst formulation in said first heterogeneous catalyst assembly by combining said second product mixture with a stream S4 and allowing said in-line intermediate branching catalyst formulation to equilibrate for a HUT-3 seconds prior to injection into said second reactor and optional injection into said third reactor, wherein said stream S4 comprises an alkyl aluminum co-catalyst in said process solvent;
d) optionally, c) is skipped and said in-line intermediate branching catalyst formulation is formed inside said second reactor and optionally inside said third reactor; wherein said second product mixture is equilibrated for an additional HUT-3 seconds and injected into said second reactor and optionally into said third reactor, and said stream S4 is independently injected into said second reactor and optionally into said third reactor, and;
e) optionally, a second heterogeneous catalyst assembly is employed wherein a) through c) are conducted to form a second in-line intermediate branching catalyst formulation that is injected into said third reactor; optionally said second in-line intermediate branching catalyst formulation is formed inside said third reactor according to d);
wherein said HUT-1 is from about 5 seconds to about 70 seconds, said HUT-2 is from about 2 seconds to about 50 seconds and said HUT-3 is from about 0.5 to about 15 seconds.

[V]-8. The process as described in [V]-7, wherein;
a) said magnesium compound is defined by the formula Mg(R1)2, wherein the R1 groups may be the same or different;
b) said aluminum alkyl is defined by the formula Al(R3)3, wherein the R3 groups may be the same or different;
c) said chloride compound is defined by the formula R2Cl;
d) said metal compound is defined by the formulas M(X)n or MO(X)n, wherein M represents titanium, zirconium, hafnium, vanadium, niobium, tantalum, chromium, molybdenum, tungsten, manganese, technetium, rhenium, iron, ruthenium, osmium or mixtures thereof, O represents oxygen, X represents a halogen atom and n is an integer that satisfies the oxidation state of the metal M, and;
e) said alkyl aluminum co-catalyst is defined by the formula Al(R4)p(OR5)q(X)r, wherein the R4 groups may be the same or different, the OR5 groups may be the same or different and (p+q+r)=3, with the proviso that p is greater than 0;
wherein R1, R2, R3, R4 and R5 represent hydrocarbyl groups having from 1 to 10 carbon atoms; optionally R2 may be a hydrogen atom.

[V]-12. The process as described in [V]-10; wherein said batch intermediate branching procatalyst comprises:
a) a magnesium compound defined by the formula Mg(R1)2, wherein R1 may be the same or different;
b) a chloride compound defined by the formula R2Cl;
c) optionally an aluminum alkyl halide defined by the formula (R6)vAlX3−v; wherein the R6 groups may be the same or different, X represents a halogen atom, and v is 1 or 2;
d) a metal compound defined by the formulas M(X)n or MO(X)n, wherein M represents titanium, zirconium, hafnium, vanadium, niobium, tantalum, chromium, molybdenum, tungsten, manganese, technetium, rhenium, iron, ruthenium, osmium or mixtures thereof, O represents oxygen, X represents a halogen atom and n is an integer that satisfies the oxidation state of the metal M;
wherein R1, R2 and R6 represent hydrocarbyl groups having from 1 to 10 carbon atoms; optionally R2 may be a hydrogen atom.

[VI]-9. The film as described in [VI]-5, wherein:
