(ii) said second ethylene interpolymer has melt index from about 0.001 to about 1000 dg/minute, a density from about 0.89 g/cm3 to about 0.965 g/cc and is from about 10 to 99 weight percent of said ethylene interpolymer product; and
(iii) optionally said third ethylene interpolymer has a melt index from about 0.1 to about 10000 dg/minute, a density from about 0.890 to about 0.965 g/cc and is from 0 to about 30 weight percent of said ethylene interpolymer product;
wherein melt index is measured according to ASTM D1238 (2.16 kg load and 190° C.), density is measured according to ASTM D792 and weight percent is the weight of said first, said second or said optional third ethylene interpolymer divided by the weight of said ethylene interpolymer product.

